protected boolean isEntryStored(String entryId,String feedId) throws IOException{
    if(this.buffer.getEntry(entryId,feedId)!=null)
            return true;

    Hits h = storageQuery(entryId);
    if(h.length() > 0)
        return true;
    return false;
}

